  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Valley
  City WMD, Hobart Lake NWR, Sibley Lake NWR, Stoney Slough NWR, and Tomahawk NWR
  outlines Refuge accomplishments during the 1991 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning
  and compliance with environmental and cultural resource mandates. Refuge administration
  is outlined; information about personnel, volunteer programs, funding, safety, and
  technical assistance is given. Habitat management is also covered; subjects include
  wetlands, croplands, grasslands, grazing, haying, fire management, pest control,
  WPA easements, and private lands. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, wildlife propagation, and marking and bird banding.
  The public uses of the Refuge described in this report include interpretive programs,
  hunting, trapping, and law enforcement. Cooperative programs and economic uses of
  the Refuge are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
